export default function Product(props) {
    return (
        <div className="product">
            <p className="product__name">LIQID {props.name}</p>
            <div className="product__details">
                <p className="product__details__value">{props.value} â‚¬</p>
                {props.growth ? <UpArrow className="product__details__icon" /> : <DownArrow className="product__details__icon" />}
                <p className="product__details__percent">{ props.percentage }%</p>
            </div>
            <Button />
        </div>
    )
}
